import Header from "../components/header";
import Main from "../components/main";
import { Section, Section2, Section3 } from "../components/sections";

import Footer from "../components/footer";
import Article from "../components/article";

const Home = () => {
  return (
    <>
      <Header />
      <Main />
      <Article />
      <Section />
      {/* section2 start */}
      <Section2 />
      {/* section2 end */}
      {/* section3 start */}
      <Section3 />
      {/* section3 end */}
      {/* footer start */}
      <Footer />
    </>
  );
};
export default Home;
